{{#display_map:Haus der Natur, Ahrensburg, Germany}}
== Park am Haus der Natur == Der Park am Haus der Natur ist ein Park in Ahrensburg. Er liegt direkt am Haus der Natur und ist ein beliebtes Ausflugsziel für Familien und Naturfreunde. Der Park ist sehr gepflegt und bietet viele Sitzmöglichkeiten.
